import "./Profile.css";

const Profile = ({name,age,country}) => {
  return (
    <div className="profile">
    <h3>{`Name:${name}`}</h3>
    <p>{`Age:${age = undefined ? "??":{age}}`}</p>
    <p>{`Country:${country = undefined ? "??":{country}}`}</p>

    </div>
  );
};


export default Profile;
